import React from 'react';
import styled from 'styled-components';
import { 
  FaUsers, 
  FaDatabase, 
  FaCogs, 
  FaBalanceScale, 
  FaServer 
} from 'react-icons/fa';

const WheelContainer = styled.div`
  position: relative;
  width: 600px;
  height: 600px;
  margin: 0 auto;
`;

const WheelContent = styled.div`
  position: relative;
  width: 100%;
  height: 100%;
`;

const CenterLogo = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 120px;
  height: 120px;
  z-index: 3;
  display: flex;
  align-items: center;
  justify-content: center;
  background: white;
  border-radius: 50%;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);

  img {
    width: 80%;
    height: 80%;
    filter: brightness(1.1) contrast(0.9);
  }
`;

const ComponentCircle = styled.div`
  position: absolute;
  width: 90px;
  height: 90px;
  border-radius: 50%;
  background-color: ${props => props.color};
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  cursor: pointer;
  transition: all 0.3s ease;
  color: white;
  z-index: 2;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);

  &:hover {
    transform: translate(-50%, -50%) scale(1.1) !important;
    box-shadow: 0 6px 12px rgba(0, 0, 0, 0.15);
  }
`;

const ComponentLabel = styled.div`
  position: absolute;
  width: 180px;
  text-align: center;
  color: #2c3e50;
  font-size: 13px;
  font-weight: 500;
  line-height: 1.4;
  margin-top: 110px;
  opacity: 0.9;
  text-shadow: 0 1px 2px rgba(255, 255, 255, 0.8);
`;

const ConnectingLine = styled.div`
  position: absolute;
  width: 140px;
  height: 1px;
  background: linear-gradient(
    90deg,
    rgba(44, 62, 80, 0.1) 0%,
    rgba(44, 62, 80, 0.2) 50%,
    rgba(44, 62, 80, 0.1) 100%
  );
  transform-origin: center;
  z-index: 1;
`;

const CenterShape = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 100px;
  height: 100px;
  background: white;
  z-index: 2;

  &::before {
    content: '';
    position: absolute;
    top: -10px;
    left: -10px;
    right: -10px;
    bottom: -10px;
    border: 1px solid rgba(44, 62, 80, 0.2);
    transform: rotate(45deg);
  }

  &::after {
    content: '';
    position: absolute;
    top: -10px;
    left: -10px;
    right: -10px;
    bottom: -10px;
    border: 1px solid rgba(44, 62, 80, 0.2);
    transform: rotate(-45deg);
  }
`;

const components = [
  {
    id: 'teams',
    name: 'Teams & Agents',
    label: 'Teams & Agents Alignment & Structure',
    icon: FaUsers,
    color: '#3498db',
    position: 'top'
  },
  {
    id: 'resources',
    name: 'Resources & Knowledge',
    label: 'Resources & The Corpus of Knowledge',
    icon: FaDatabase,
    color: '#2ecc71',
    position: 'right'
  },
  {
    id: 'actions',
    name: 'Actions & Orchestrations',
    label: 'Actions & Orchestrations Planning',
    icon: FaCogs,
    color: '#e74c3c',
    position: 'bottomRight'
  },
  {
    id: 'compliance',
    name: 'Compliance & Alignment',
    label: 'Compliance, Guardrails & Alignment',
    icon: FaBalanceScale,
    color: '#f39c12',
    position: 'bottomLeft'
  },
  {
    id: 'execution',
    name: 'Execution Infrastructure',
    label: 'Execution Infrastructure & Tech Architecture',
    icon: FaServer,
    color: '#9b59b6',
    position: 'left'
  }
];

const getPosition = (position) => {
  const distance = 170;
  const centerOffset = '50%';

  switch (position) {
    case 'top':
      return { 
        left: centerOffset, 
        top: `calc(${centerOffset} - ${distance}px)` 
      };
    case 'right':
      return { 
        left: `calc(${centerOffset} + ${distance}px)`, 
        top: centerOffset 
      };
    case 'bottomRight':
      return { 
        left: `calc(${centerOffset} + ${distance * 0.7}px)`, 
        top: `calc(${centerOffset} + ${distance * 0.7}px)` 
      };
    case 'bottomLeft':
      return { 
        left: `calc(${centerOffset} - ${distance * 0.7}px)`, 
        top: `calc(${centerOffset} + ${distance * 0.7}px)` 
      };
    case 'left':
      return { 
        left: `calc(${centerOffset} - ${distance}px)`, 
        top: centerOffset 
      };
    default:
      return { left: centerOffset, top: centerOffset };
  }
};

const getLineAngle = (position) => {
  switch (position) {
    case 'top': return '0deg';
    case 'right': return '72deg';
    case 'bottomRight': return '144deg';
    case 'bottomLeft': return '216deg';
    case 'left': return '288deg';
    default: return '0deg';
  }
};

function FrameworkWheel({ onComponentSelect }) {
  return (
    <WheelContainer>
      <WheelContent>
        <CenterShape />
        <CenterLogo>
          <img src="/inocta-logo.svg" alt="Inocta Logo" />
        </CenterLogo>
        {components.map((component) => {
          const position = getPosition(component.position);
          return (
            <React.Fragment key={component.id}>
              <ConnectingLine
                style={{
                  left: '50%',
                  top: '50%',
                  transform: `translateX(-50%) rotate(${getLineAngle(component.position)})`
                }}
              />
              <ComponentCircle
                color={component.color}
                onClick={() => onComponentSelect(component)}
                style={{
                  ...position,
                  transform: 'translate(-50%, -50%)'
                }}
              >
                <component.icon size={28} />
                <div style={{ 
                  fontSize: '11px', 
                  marginTop: '6px', 
                  textAlign: 'center',
                  fontWeight: '500',
                  lineHeight: '1.2'
                }}>
                  {component.name}
                </div>
              </ComponentCircle>
              <ComponentLabel
                style={{
                  ...position,
                  transform: 'translate(-50%, -50%)'
                }}
              >
                {component.label}
              </ComponentLabel>
            </React.Fragment>
          );
        })}
      </WheelContent>
    </WheelContainer>
  );
}

export default FrameworkWheel;
